import React, { Component } from 'react';

class CarMakesList extends Component {

  render() {
    const { makes } = this.props
    console.log(makes);
    return (
      <div>
        Here are some car makes....
        {
          makes.map((make,id) => {
            return <CarMake.js key={make.id} make={make}/>
          })
        }
      </div>
    );
  }

}

export default CarMakesList;
